export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},lw83WP45Du:{data:{id:763,attributes:{imdbId:"tt0810819",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjA0NjA4NjE2Nl5BMl5BanBnXkFtZTgwNzIxNTY2NjE@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"},{Source:"Metacritic",Value:"66\u002F100"}],item_lang:{data:{id:1426,attributes:{title:e,plot:"Copenhagen, Denmark, 1926. Einar Wegener (played by Eddie Redmayne) and his wife Gerda (Alicia Vikander) are a happily married couple. Both are artists, Einar preferring landscapes and she portraits. One day Einar poses for a portrait of Gerda's while wearing a dress. This is initially done as a lark, as is the later attendance at a party dressed as a woman. However, Einar soon discovers that she is in fact a woman and over time prefers being Lili. At first she and Gerda try to have her situation \"cured\" but this leads nowhere (other than to many doctors trying to have Lili locked up as a pervert and\u002For lunatic). Her voyage of self-discovery will ultimately lead to her undergoing the first ever sex-change operation.",slug:"the-danish-girl"}}},books:{data:[{id:4887,attributes:{title:e,description:"Starring Academy Award-winner Eddie Redmayne and directed by Academy Award-winner Tom Hooper, this major motion picture portrays an unforgettable celebration of love. It starts with a question, a simple favour asked by a wife of her husband, setting off a transformation neither can anticipate. Einar Wegener and his American wife Greta Waud have been married for six years, but are yet to have a child. Both painters, they live a life of bohemian languor in Copenhagen until one day their lives are irreversibly altered. The Danish Girl eloquently shows the intimacy that defines a marriage and the nearly forgotten story of the love between a man who discovers that he is, in fact, a woman, and his wife who would sacrifice anything for him. Set against the glitz and decadence of 1920s Copenhagen, Paris and Dresden, and inspired by a true story, The Danish Girl is about one of the most passionate and unusual marriages of the twentieth century. 'a story of true love, suffering and sacrifice' - Sunday Telegraph",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fntdCwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2015-12-01",publisher:"Allen & Unwin",subtitle:a}},{id:4888,attributes:{title:"Danish girl",description:"A Copenhague en 1925 Einar Wegener et Greta Waud, son épouse, forment un couple étonnant. Lui, peintre paysagiste reconnu, petit, délicat, est discret jusqu'à l'effacement. Elle, peintre également, est grande, américaine, blonde et issue d'une famille riche. Tous deux s'harmonisent étrangement jusqu'au jour où Greta, en l'absence de son modèle féminin, demande à son mari d'enfiler une paire de bas. De cette demande et du trouble qu'il en advient va naître Lili, qui petit à petit prendra le dessus sur celui qui l'a engendré comme par inadvertance. Einar se sent femme. Il ne se déguise pas, ne joue pas. Il est celle qui peut tomber amoureuse, et désire donner la vie. Il sera le premier homme, en pleine montée du nazisme, à changer physiquement de sexe. Une histoire vraie, celle du premier transsexuel connu, que David Ebershoff retrace ici avec une délicatesse et une force remarquables.",thumbnail:a,authors:[b],firstBook:d,published:"2012-01-01",publisher:"Editions Phébus",subtitle:"roman"}},{id:4889,attributes:{title:"The danish girl",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CyyHjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2016-01-01",publisher:a,subtitle:a}},{id:4890,attributes:{title:e,description:"A shockingly original novel based on the true story of the first first man to undergo a sex-change operation and the woman who loves him. One of the most passionate and unusual love stories of the 20th century, it is currently being made into a feature film starring Nicole Kidman and Charlize Theron. Set against the glitz and decadence of 1920s Copenhagen, Paris and Dresden, and inspired by a true story, The Danish Girl is about one of the most passionate and unusual marriages of the twentieth century. Einar Wegener and his American wife Greta Waud have been married for six years, but are yet to have a child. Both painters, they live a life of bohemian languor in Copenhagen until one day their lives are irreversibly altered. The Danish Girl eloquently portrays the intimacy that defines a marriage and the nearly forgotten story of the love between a man who discovers that he is, in fact, a woman, and his wife who would sacrifice anything for him. This elegantly written, sensual and engrossing novel is a wonderful celebration of love. With great sensitivity and intelligence, David Ebershoff tells the story of this extraordinary marriage, which survives the hardest test any couple could face. Praise for The Danish Girl: 'an engrossing story of true love, suffering and sacrifice' - Sunday Telegraph. 'A quality of extraordinariness. . . an astonishing idea, rendered arrestingly: a hypnotising uniqueness' - Courier-Mail. 'An enthralling read' - The Times. 'An unusual and affecting love story' - New York Times.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XIx6rgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2009-01-01",publisher:a,subtitle:a}},{id:4891,attributes:{title:"The Rose City",description:"Written with understanding and familiarity, these seven stories present characters who are coming into their own as they discover and rediscover themselves. In \"Chuck Paa,\" a young man in flight from his mother seeks and finds employment in an upscale world, which can never quite become his own. The title story, \"The Rose City,\" tells how a shared lost love brings together two friends who reunite to reflect on their past, their present, and what lies ahead. With the same insight and daring of The Danish Girl, The Rose City secures David Ebershoff's reputation as a writer of rare talent and sensitivity.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0qZG37MXe30C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2002-04-30",publisher:"Penguin",subtitle:"Stories"}}]}}},meta:{}}},prerenderedAt:1681377278731}}("","David Ebershoff","movie",null,"The Danish Girl","series",1))